import classes from './App.module.css';

function App() {
  return (

  <div className={classes.container}>

      <header>
        <div>

          <h1> this is header </h1>

        </div>

      </header>


          <section className={classes.main} >
              <h2>Main Content</h2>
          </section>


          <aside className={classes.sidebar}>
              <h3 >Sidebar</h3>
          </aside>


      <footer>
          <h3>Footer</h3>

      </footer>
      <div> Second footer</div> 

  </div>


  );
};

export default App;
